What is the output of the following code snippet?

```
def func(x):
    return 1 / x

try:
    print(func(0))
except ZeroDivisionError:
    print('Error: Division by zero')
```

What is the output of the following code snippet?

```
def func(a, b):
    return a / b

try:
    print(func(5, 0))
except Exception as e:
    print(e)
```
